import React from 'react';
import ReactFullpage from '@fullpage/react-fullpage';

function Layout(props) {
  const fullpageOptions = {
    scrollOverflow: true,
    sectionsColor: ["orange", "purple", "green"],
  };

  return (
    <ReactFullpage {...fullpageOptions}>
      {({ fullpageApi }) => (
        <div id="fullpage-wrapper">
          <div className="section">
            <h3>Section 1</h3>
          </div>
          <div className="section">
            <div className="slide">
              <h3>Slide 2.1</h3>
            </div>
            <div className="slide">
              <h3>Slide 2.2</h3>
            </div>
            <div className="slide">
              <h3>Slide 2.3</h3>
            </div>
          </div>
          <div className="section">
            <h3>Section 3</h3>
            <button onClick={() => fullpageApi.moveTo(1, 0)}>Move to top</button>
          </div>
        </div>
      )}
    </ReactFullpage>
  );
}

export default Layout;
